// material-ui
import { useState, useRef, useEffect } from 'react';
import {
    Avatar,
    Button,
    Drawer,
    Fab,
    FormControl,
    FormControlLabel,
    Grid,
    IconButton,
    Radio,
    RadioGroup,
    Slider,
    Tooltip,
    Typography
} from '@mui/material';
import { useTheme } from '@mui/material/styles';
// project imports
import MainCard from 'ui-component/cards/MainCard';
import User1 from 'assets/images/users/user-round.svg';
import Divider from '@mui/material/Divider';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';
// ==============================|| SAMPLE PAGE ||============================== //

const Profile = () => {
    const theme = useTheme();
    const anchorRef = useRef(null);
    return (
        <Grid container spacing={2}>
            <Grid item xs={12}>
                <MainCard>
                    <Grid container spacing={2}>
                        <Grid item xs={12}>
                            <Typography
                                style={{
                                    textAlign: 'center',
                                    fontSize: '2.5rem',
                                    fontWeight: 'bold',
                                    marginBottom: '1.5rem'
                                }}
                                variant="h1"
                            >
                                Profile
                            </Typography>
                        </Grid>
                        <Grid item xs={12}>
                            <Avatar
                                src={User1}
                                sx={{
                                    ...theme.typography.mediumAvatar,
                                    // margin: '8px 0 8px 8px !important',
                                    cursor: 'pointer',
                                    width: '10rem',
                                    height: 'auto',
                                    display: 'block',
                                    margin: '0 auto',
                                    marginBottom: '4rem'
                                }}
                                ref={anchorRef}
                                // aria-controls={open ? 'menu-list-grow' : undefined}
                                // aria-haspopup="true"
                                color="inherit"
                            />
                        </Grid>
                    </Grid>
                    <Grid container justifyContent="center" direction="row" spacing={2}>
                        {/* Left Column */}
                        <Grid item xs={5}>
                            <Grid spacing={2} container direction="column" justifyContent="center">
                                <Grid item xs={12}>
                                    <TextField fullWidth style={{}} id="outlined-error" label="Name" defaultValue="Hello World" />
                                </Grid>

                                <Grid item xs={12}>
                                    <TextField fullWidth id="outlined-error" label="Email" defaultValue="Hello World" />
                                </Grid>
                            </Grid>
                        </Grid>
                        {/* Midspace */}
                        <Grid item xs={0.1} alignItems="center">
                            <Divider variant="center" orientation="vertical" />
                        </Grid>
                        {/* Right Column */}
                        <Grid item xs={5}>
                            <Grid spacing={2} container direction="column" justifyContent="center">
                                <Grid item xs={12}>
                                    <TextField fullWidth style={{}} id="outlined-error" label="Name2" defaultValue="Hello World" />
                                </Grid>

                                <Grid item xs={12}>
                                    <TextField fullWidth id="outlined-error" label="Email2" defaultValue="Hello World" />
                                </Grid>

                                <Grid item xs={12}>
                                    <TextField fullWidth id="outlined-error" label="Email2" defaultValue="Hello World" />
                                </Grid>
                            </Grid>
                        </Grid>
                    </Grid>
                    <Button width="20rem" style={{ backgroundColor: 'blue' }}>
                        Edit Profile
                    </Button>
                </MainCard>
            </Grid>
        </Grid>
    );
};

export default Profile;
